B.Mn=new A.fy("0","Sholawatan","**Sholawatan** is a lyric app that I developed using Flutter and Firebase. It uses a DDD (Domain-Driven Design) architecture, which makes it easy to maintain and extend.\n\nSholawatan is a great way to learn about and listen to shalawat, and it is a valuable resource for Muslims of all ages.\n\n**Key features:**\n\n* Large collection of shalawat\n* Ability to save favorite shalawat\n* Ability to share shalawat with others\n* Built using Flutter and Firebase\n* Uses a DDD (Domain-Driven Design) architecture\n* Uses BloC (Business Logic Component) design pattern\n\n**Technical details:**\n\n* The app is built using Flutter, a cross-platform mobile development framework.\n* The backend is built using Firebase, a cloud-based platform that provides a variety of services, including database storage, authentication, and real-time messaging.\n* The app uses a DDD (Domain-Driven Design) architecture, which helps to keep the code organized and easy to maintain.\n* The app uses BloC library, a predictable state management library that helps implement the BLoC (Business Logic Component) design pattern.\n\n**I am proud of this project because it was my first Flutter app with DDD architecture. I learned a lot about DDD architecture while developing this app, and I am confident that I can use these skills to develop other great apps in the future.**\n","A lyric app that allows users to find and listen to shalawat (praises) to the Prophet Muhammad",null,null,B.GC,B.mV,B.JH,B.Gq,!0)
